import * as React from 'react';
import { Box, AppBar, Toolbar, IconButton, Typography, Menu, Container, Avatar, Button, Tooltip, MenuItem, Divider, Stack, useMediaQuery } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import ExploreIcon from '@mui/icons-material/Explore';
import StorefrontRoundedIcon from '@mui/icons-material/StorefrontRounded';
import Groups2RoundedIcon from '@mui/icons-material/Groups2Rounded';
import { ThemeProvider, createTheme, Hidden } from '@mui/material';
import DesktopAppBar from './DesktopAppBar';
import MobileAppBar from './MobileAppBar';
import { Link, useNavigate, Outlet } from 'react-router-dom'
import './AppBar.css'

const pages = ['Discover', 'Market place', 'Clubs'];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

export default function ResponsiveAppBar(props) {

    const theme = createTheme({
        status: {
          danger: '#e53e3e',
        },
        palette: {
          primary: {
            main: '#636e51', //SUSITA MAIN COLOR CODE
            darker: '#Eef3eb',
          },
          gray: {
            main: '#686869', //SUSITA gray COLOR CODE
            darker: '#3d3d3d',
          },
          neutral: {
            main: '#64748B',
            contrastText: '#fff',
          },
        },
      });

    return (
      <ThemeProvider theme={theme}>
        <Hidden smDown>
          <DesktopAppBar {...props} />
        </Hidden>
        <Hidden mdUp>
          <MobileAppBar {...props} />
        </Hidden>
      </ThemeProvider>
    );
  }
